"Pleasure in the Job, puts perfection in the work” - Aristotle
Just wrapped up one of my favorite projects to date with @oneplus shot 100% on the OnePlus 9 Pro in collaboration with my good friend @bryn_north 🥳🤘🏽
It was so freeing to take on a project like this with nothing but a few phones and the intention of having a good time with friends. Thats why this turned out to be one of my favourite videos to date. 
Video is live on my youtube! Link in bio! 

